import { Card, Elevation, Button } from '@blueprintjs/core';
import CardHeader from '../../../components/Card/CardHeader';
import CardBody from '../../../components/Card/CardBody';
import CardFooter from '../../../components/Card/CardFooter';
import LineChart from '../../../components/Charts/ApexChart/LineChart';

export default class TestComponent1 extends Component {
   render() {
      return (
         <div>
            Test Component 2
            <Card elevation={Elevation.THREE} className='m-3'>
               <CardHeader>Analytical applications</CardHeader>
               <CardBody>
                  <LineChart></LineChart>
                  <Button icon='document'>Upload...</Button>
               </CardBody>
               <CardFooter>asd</CardFooter>
            </Card>
         </div>
      );
   }
}
